--
-- Name: chat_recent_messages; Type: VIEW; Schema: public; Owner: eastern_estate
--

CREATE VIEW public.chat_recent_messages AS
 SELECT cm.id,
    cm.chat_group_id,
    cm.message_text,
    cm.created_at,
    cm.sender_employee_id,
    e.full_name AS sender_name,
    e.email AS sender_email,
    cg.name AS group_name,
    cg.group_type,
    ( SELECT count(*) AS count
           FROM public.chat_attachments
          WHERE (chat_attachments.message_id = cm.id)) AS attachment_count
   FROM ((public.chat_messages cm
     JOIN public.employees e ON ((cm.sender_employee_id = e.id)))
     JOIN public.chat_groups cg ON ((cm.chat_group_id = cg.id)))
  WHERE (cm.is_deleted = false)
  ORDER BY cm.created_at DESC;


ALTER VIEW public.chat_recent_messages OWNER TO eastern_estate;

--
-- Name: chat_unread_counts; Type: VIEW; Schema: public; Owner: eastern_estate
--

CREATE VIEW public.chat_unread_counts AS
 SELECT cp.employee_id,
    cp.chat_group_id,
    cg.name AS group_name,
    count(cm.id) AS unread_count
   FROM ((public.chat_participants cp
     JOIN public.chat_groups cg ON ((cp.chat_group_id = cg.id)))
     LEFT JOIN public.chat_messages cm ON (((cm.chat_group_id = cp.chat_group_id) AND (cm.created_at > COALESCE(cp.last_read_at, ('1970-01-01 00:00:00'::timestamp without time zone)::timestamp with time zone)) AND (cm.sender_employee_id <> cp.employee_id) AND (cm.is_deleted = false))))
  WHERE ((cp.is_active = true) AND (cg.is_active = true))
  GROUP BY cp.employee_id, cp.chat_group_id, cg.name;


