--
-- Name: vw_tower_inventory_summary; Type: MATERIALIZED VIEW; Schema: public; Owner: eastern_estate
--

CREATE MATERIALIZED VIEW public.vw_tower_inventory_summary AS
 WITH flat_counts AS (
         SELECT flats.tower_id,
            count(*) AS units_defined
           FROM public.flats
          WHERE (flats.is_active = true)
          GROUP BY flats.tower_id
        ), flat_status_breakdown AS (
         SELECT breakdown.tower_id,
            jsonb_object_agg(breakdown.status, breakdown.cnt ORDER BY breakdown.status) AS units_by_status
           FROM ( SELECT flats.tower_id,
                    flats.status,
                    count(*) AS cnt
                   FROM public.flats
                  WHERE (flats.is_active = true)
                  GROUP BY flats.tower_id, flats.status) breakdown
          GROUP BY breakdown.tower_id
        )
 SELECT t.id AS tower_id,
    t.property_id,
    COALESCE(t.units_planned, 0) AS units_planned,
    COALESCE(t.total_units, 0) AS units_total,
    COALESCE(fc.units_defined, (0)::bigint) AS units_defined,
    COALESCE(t.data_completion_pct, (0)::numeric) AS data_completion_pct,
    COALESCE((t.data_completeness_status)::text, 'NOT_STARTED'::text) AS data_completeness_status,
    COALESCE(t.issues_count, 0) AS issues_count,
    COALESCE(fs.units_by_status, '{}'::jsonb) AS units_by_status
   FROM ((public.towers t
     LEFT JOIN flat_counts fc ON ((fc.tower_id = t.id)))
     LEFT JOIN flat_status_breakdown fs ON ((fs.tower_id = t.id)))
  WITH NO DATA;


ALTER MATERIALIZED VIEW public.vw_tower_inventory_summary OWNER TO eastern_estate;

