--
-- Name: vw_property_inventory_summary; Type: MATERIALIZED VIEW; Schema: public; Owner: eastern_estate
--

CREATE MATERIALIZED VIEW public.vw_property_inventory_summary AS
 SELECT p.id AS property_id,
    COALESCE(p.total_towers_planned, p.number_of_towers, 0) AS towers_planned,
    count(DISTINCT t.id) FILTER (WHERE (t.is_active = true)) AS towers_defined,
    COALESCE(p.total_units_planned, p.number_of_units, 0) AS units_planned,
    count(DISTINCT f.id) FILTER (WHERE (f.is_active = true)) AS units_defined,
    COALESCE(p.data_completion_pct, (0)::numeric) AS data_completion_pct,
    COALESCE((p.data_completeness_status)::text, 'NOT_STARTED'::text) AS data_completeness_status,
    GREATEST((COALESCE(p.total_towers_planned, p.number_of_towers, 0) - count(DISTINCT t.id) FILTER (WHERE (t.is_active = true))), (0)::bigint) AS missing_towers,
    GREATEST((COALESCE(p.total_units_planned, p.number_of_units, 0) - count(DISTINCT f.id) FILTER (WHERE (f.is_active = true))), (0)::bigint) AS missing_units
   FROM ((public.properties p
     LEFT JOIN public.towers t ON ((t.property_id = p.id)))
     LEFT JOIN public.flats f ON ((f.tower_id = t.id)))
  GROUP BY p.id
  WITH NO DATA;


